import usePosts from '../../hooks/usePosts/usePosts';
import Post from '../Post/Post'; 

export default function Posts(){
    const [posts] = usePosts();
    
    return(
        <div>
            {posts.map((post)=><Post
                title={post.title}
                description={post.description}
            ></Post>)}
        </div>
    )
}
